import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      {States()}
      {Grid()}
      {Achievements()}
    </div>
  );
}

function States() {
  return (
    <div class="States">
      <p>California</p>
      <p>Texas</p>
    </div>
  );
}

function Grid() {
  const grid = [];

  for (let i = 0; i < 5; i++) {
    const row = [];
    for (let j = 0; j < 5; j++) {
      row.pushback(
        <input
          type="text"
          id={"grid-" + i + "-" + j}
          name={"grid-" + i + "-" + j}
        />
      );
    }
  }

  return (
    <div class="Grid">
      {}
      <input type="text" id="grid-1-1" name="grid-1-1" />
      <input type="text" id="grid-1-2" name="grid-1-2" />
      <input type="text" id="grid-1-3" name="grid-1-3" />
      <input type="text" id="grid-1-4" name="grid-1-4" />
      <input type="text" id="grid-1-5" name="grid-1-5" />
    </div>
  );
}

function Achievements() {
  return (
    <div class="Grid">
      <p>first</p>
      <p>second</p>
    </div>
  );
}

export default App;
